import React from 'react';
import SortingVisualizer from './SortingVisualizer/SortingVisualizer';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Nav from 'react-bootstrap/Nav'
import './App.css';

function App() {
  return (
    <div className="App">

      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand href="#home">Sorting-Visualizer</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#features">Generate new Array</Nav.Link>
            <Nav.Link href="#pricing">Sort</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="#deets">Merge-Sort</Nav.Link>
            <Nav.Link href="#deets">Heap-Sort</Nav.Link>
            <Nav.Link href="#deets">Quick-Sort</Nav.Link>
            <Nav.Link href="#deets">Bubble-Sort</Nav.Link>            
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <SortingVisualizer> </SortingVisualizer>
    </div>
  );
}

export default App;
